<?php
    require_once APPPATH."third_party/PHPMailer/PHPMailerAutoload.php";
    require APPPATH.'third_party/PHPMailer/class.phpmailer.php';

    function sendEmailPHPMailer($subject,$addAddress_email,$message_email){
		$username 		= 'wisely.interindo@gmail.com';
		$pass			    = '56968177z';
    //https://www.google.com/settings/security/lesssecureapps untuk setting ijin mengirim email dengan gmail

        $mail = new PHPMailer;
        $mail->isSMTP();                                      // Set mailer to use SMTP
        $mail->Host 	    = 'smtp.gmail.com';                 // Specify main and backup SMTP servers
        $mail->SMTPAuth   = true;                             // Enable SMTP authentication
        $mail->Username   = $username;        				        // SMTP username
        $mail->Password   = $pass;           				          // SMTP password
        $mail->SMTPSecure = 'ssl';                            // Enable TLS encryption, `ssl` also accepted
        $mail->Port       = '465';                            // TCP port to connect to
        $mail->SMTPDebug  = 0;

	      $mail->SMTPOptions = array(
    			'ssl'                => array(
    			'verify_peer'        => false,
    			'verify_peer_name'   => false,
    			'allow_self_signed'  => true
    			)
    		);

		    $mail->setFrom($username, 'Latihan CodeIgniter');
        $mail->addAddress($addAddress_email);                 // Name is optional
        $mail->isHTML(true);                                  // Set email format to HTML
        // $mail->AddAttachment($_SERVER["DOCUMENT_ROOT"] . 'choiseulkilinacosplaygstar.jpg', 'attachment.jpg');
        $contact_image_data = getImage();
        $data     = substr($contact_image_data, strpos($contact_image_data, ","));
        $filename = "attachment.png";
        $encoding = "base64";
        $type     = "image/png";
        $mail->AddStringAttachment(base64_decode($data), $filename, $encoding, $type);

        $mail->Subject 			  = $subject;
        $mail->Body    			  = $message_email;
		    $mail->Timeout       	= 8; // set the timeout (seconds)
		    $mail->SMTPKeepAlive 	= true; // don't close the connection between messages

        if(!$mail->send()){
          //echo 'Message could not be sent.';
          echo 'Mailer Error: ' . $mail->ErrorInfo;
    			$mail->SmtpClose(); // close the connection since it was left open.
    			return false;
        }else{
    			//echo 'Message has been sent';
    			$mail->SmtpClose(); // close the connection since it was left open.
    			return true;
        }
    }

    function getImage(){
      return "data:image/png;base64,";
    }
?>
